// Complete the maxValue function below.
func maxValue(t string) int {

	var lent = len(t)

	var ubiSize = 100
	var initUbiSizeMap = 10 * lent
	var ubicaciones = make(map[string][]int, initUbiSizeMap) // 30*len(t)

	for i := range t {
		for k := 1; k <= ubiSize; k++ {
			if i+k <= lent {
				key := t[i : i+k]
				ubicaciones[key] = append(ubicaciones[key], i)
			}
		}
	}

	// maximo a superar
	var max = lent

	fmt.Printf("lent = %d, max = %d\n", lent, max)

	for lensub := 1; lensub <= lent; lensub++ {

		if lensub%1000 == 0 {
			fmt.Printf("lensub = %d, max = %d\n", lensub, max)
		}

		for i := 0; i+lensub <= lent; i++ {

			var maxNroVecesSub = lent - lensub + 1
			var vecesMinRequerido = int(math.Floor(float64(max) / float64(lensub)))

			// si el nro veces que debe repetirse la sub es menor que lo maximo de veces que puede repetirse, no procesar
			if vecesMinRequerido > maxNroVecesSub {
				break
			}

			valueF := f(i, lensub, t, lent, ubiSize, ubicaciones, maxNroVecesSub, vecesMinRequerido)

			// TODO: fixme, este caso particular hace que se salte todo un for.
			//       hay quee usar un mapa donde se guarden los valores especificos de esa subcadena
			//       para sacarle provecho

			// caso especial: indicador que no importa la posicion i, ese substring nunca superar√° el vecesMinRequerido
			if valueF < 0 {
				break
			}

			if valueF > max {
				max = valueF
			}
		}
	}

	fmt.Printf("ubicaciones size: aproximada = %d, real = %d\n", initUbiSizeMap, len(ubicaciones))

	return max
}

func f(iniSub int, lensub int, t string, lent int, ubiSize int, ubicaciones map[string][]int,
	maxNroVecesSub int, vecesMinRequerido int) int {

	var sub = t[iniSub : iniSub+lensub]

	// k es el numero de digitos de las subcadenas
	var k = ubiSize
	if lensub < k {
		k = lensub
	}

	// mejora opcional: si el substring esta en su totatlidad en ubicaciones, retornarlo directamente
	if k == lensub {
		lenubis := len(ubicaciones[sub])
		if lenubis > 0 {
			if lenubis < vecesMinRequerido {
				// indicador que no se va a encontrar ese substring especifico en ninguna posicion
				return -1
			}
			return lensub * lenubis
		}
		// TODO: revisar si el if lenubis < vecesMinRequerido { debe ir aqui
	}

	var ubis []int
	for k > 0 && k <= lensub && len(ubis) == 0 {
		ubis = ubicaciones[sub[0:k]]
		k--
	}

	var lenubis = len(ubis)

	// propiedad, veces(X) <= veces(Y) donde Y es una subcadena de X
	if lenubis < vecesMinRequerido {
		return -1
	}

	var veces = 0
	var maxSize = lent - lensub + 1

	for idx, i := range ubis {
		if i < maxSize {
			if sub == t[i:i+lensub] {
				veces++
			}
			// propiedad, veces(X) <= veces(Y) donde Y es una subcadena de X
			if veces+lenubis-idx < vecesMinRequerido {
				return -1
			}
		} else {
			break
		}
	}

	return lensub * veces
}

